  \"High-Conductance Thermal Interfaces Based on Carbon Nanotubes Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T21:54:00.533858\",\n\t\"name\": \"high-conductance-thermal-interfaces-based-on-carbon-nanotubes-project-9f16b\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"We propose to develop a novel thermal interface
  material (TIM) that is based on an array of vertical carbon nanotubes (CNTs) for
  high heat flux applications.  For high precision, spaceborne lasers and other high
  power devices critical to NASA's Science Mission Directorate, heat flux levels are
  projected to reach 100 W/cm2.  The state-of-the-art in space-compatible thermal
  interface materials (TIMs) is limited to a maximum achievable thermal conductance
  of approximately 5 W/cm2&lt;SUP&gt;o&lt;/SUP&gt;C.  Preliminary testing of our innovative
  TIM approach has demonstrated thermal conductance values of rn33 W/cm2&lt;SUP&gt;o&lt;/SUP&gt;C,
  a nearly seven-fold increase.  For an incident heat flux of 100 W/cm2, this corresponds
  to a temperature drop of only 3&lt;SUP&gt;o&lt;/SUP&gt;C, compared with 20&lt;SUP&gt;o&lt;/SUP&gt;C
  for current technology.  Thus, the use of our innovative CNT-based TIM will enable
  increased reliability, decreased size, and increased performance of spaceborne thermal
  management systems for the SMD.rn\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
